application.args=
application.title=SysTest
application.vendor=echou
build.classes.dir=${build.dir}/classes
build.classes.excludes=**/*.java,**/*.form
# This directory is removed when the project is cleaned:
build.dir=build
build.generated.dir=${build.dir}/generated
# Only compile against the classpath explicitly listed here:
build.sysclasspath=ignore
build.test.classes.dir=${build.dir}/test/classes
build.test.results.dir=${build.dir}/test/results
debug.classpath=\
    ${run.classpath}
debug.test.classpath=\
    ${run.test.classpath}
# This directory is removed when the project is cleaned:
dist.dir=dist
dist.jar=${dist.dir}/SysTest.jar
dist.javadoc.dir=${dist.dir}/javadoc
excludes=
file.reference.activation.jar=../EJBMonitors/dist/lib/activation.jar
file.reference.FastInfoset.jar=../EJBMonitors/dist/lib/FastInfoset.jar
file.reference.http.jar=../EJBMonitors/dist/lib/http.jar
file.reference.jaxb-api.jar=../EJBMonitors/dist/lib/jaxb-api.jar
file.reference.jaxb-impl.jar=../EJBMonitors/dist/lib/jaxb-impl.jar
file.reference.jaxb-xjc.jar=../EJBMonitors/dist/lib/jaxb-xjc.jar
file.reference.jaxws-api.jar=../EJBMonitors/dist/lib/jaxws-api.jar
file.reference.jaxws-rt.jar=../EJBMonitors/dist/lib/jaxws-rt.jar
file.reference.jaxws-tools.jar=../EJBMonitors/dist/lib/jaxws-tools.jar
file.reference.jsr173_api.jar=../EJBMonitors/dist/lib/jsr173_api.jar
file.reference.jsr181-api.jar=../EJBMonitors/dist/lib/jsr181-api.jar
file.reference.jsr250-api.jar=../EJBMonitors/dist/lib/jsr250-api.jar
